INSERT INTO `cms_article` VALUES ('11', '5', '湖北红君光伏简介', '', '', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/09/ind-xt1.jpg', '关键字1,关键字2', '北京清大农研机械设备有限公司成立于2008奥运年，是国内较早进入光伏发电行业的实体企业。公司成立10年来，始终与清华大学张森教授保持深度紧密合作，依托名校雄厚的技术力量，在太阳能光电，光热领域，尤其是在单/多晶硅光伏板及并（离）网逆变器等主流', '0', null, '47', ',null,', '', '', '1', '2013-05-27 08:00:00', '1', '2017-09-13 14:47:43', null, '0');
