INSERT INTO `cms_article` VALUES ('3182c3d09c4740a5b94d4b5ec2eae042', '4', '收益分析', '', '', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/09/ind-xt3.jpg', 'Benefit analysis', '对家庭分布式光伏电站实行按照全电量补贴的政策，电价补贴标准为每千瓦时0.42元（含税），通过可再生能源发展基金予以支持，由电网公司转付，其中，分布式光伏发电系统自发自用余电上网的电量，由电网企业按照当地燃煤机组标杆上网电价收购&hellip;&hellip;', '0', null, '13', ',null,', '', '', '1', '2017-09-14 14:52:20', '1', '2017-09-26 16:47:44', null, '0');
INSERT INTO `cms_article` VALUES ('32', '12', '文章标题标题标题标题', null, null, null, '关键字1,关键字2', null, '0', null, '1', null, null, null, '1', '2013-05-27 08:00:00', '1', '2013-05-27 08:00:00', null, '0');
INSERT INTO `cms_article` VALUES ('32e52a0fbf6446259d876b72e702061d', '4', '工程方案', '', '', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/09/ind-xt4.jpg', 'Engineering plan', '北京清大农研机械设备有限公司为质量，环境管理认证企业，公司旗下光伏发电知名品牌&ldquo;中电万投&rdquo;近年来服务过的大型工程已超过300多例，很多工程已成为当地政府部门的光伏发电示范工程，成为当地光伏交流的样板基地&hellip;&hellip;', '0', null, '8', ',null,', '', '', '1', '2017-08-30 17:49:41', '1', '2017-09-14 14:40:00', null, '1');
