INSERT INTO `cms_article` VALUES ('3f73b591706649d3ad461d0eaf6cdd62', '4', '国家政策', '', '', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/09/ind-xt8.jpg', 'National policy', '1、国家能源局《关于印发2016年定点扶贫与对口支援工作要点的通知》。2、七部门联合发布《关于金融助推脱贫攻坚的实施意见》。3、国家发改委《关于实施光伏发电扶贫工作的意见》。4、国家能源局《关于在能源领域积极推广政府和社会资本合作模式的&hellip;&hellip;', '0', null, '3', ',null,', '', '', '1', '2017-08-30 17:48:17', '1', '2017-09-26 16:50:30', null, '0');
