INSERT INTO `cms_article` VALUES ('53802c8e1fdc4b958e6d6cb17477595b', '4', '屋顶电站', '', '', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/09/ind-xt6.jpg', 'Power station', '中电万投家庭光伏发电站的优势：1、可以完全实现&ldquo;自发自用，余电上网&rdquo;或者&ldquo;全额上网&rdquo;，年收益率达到10%以上，胜过任何理财产品，远远高于银行存款利息，没有任何风险，用户坐收渔利。2、可以选择安装在自家屋顶，不影响住宅空间，还能美化&hellip;&hellip;', '0', null, '3', ',null,', '', '', '1', '2017-08-30 17:48:51', '1', '2017-09-14 14:46:47', null, '0');
INSERT INTO `cms_article` VALUES ('598a274d70cd47189f7bd254e1e7d673', '4', '工程方案', '', '', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/09/ind-xt4.jpg', 'Engineering plan', '北京清大农研机械设备有限公司为质量，环境管理认证企业，公司旗下光伏发电知名品牌&ldquo;中电万投&rdquo;近年来服务过的大型工程已超过300多例，很多工程已成为当地政府部门的光伏发电示范工程，成为当地光伏交流的样板基地&hellip;&hellip;', '0', null, '6', ',null,', '', '', '1', '2017-09-14 14:51:39', '1', '2017-09-14 14:51:39', null, '0');
