INSERT INTO `cms_article` VALUES ('7aada2d70d684febaa78d9893e647039', 'd144b931d6e34941ad687d0b7c7ee161', '并网流程', '', '', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/09/ind-xt10.jpg', 'Grid process', '太阳能发电如何并网？由光伏硅电池基板经过光照产生直流电，N个基板组产生的直流电通过汇流箱，经由直流开关柜输入到太阳能逆变器，由逆变器完成直流到交流的过程，逆变出来的交流电经交流开关柜连接升压变压器，升压后通过高压交流开关柜并了电网&hellip;&hellip;', '0', null, '1', ',null,', '', '', '1', '2017-09-15 10:23:45', '1', '2017-09-15 10:23:45', null, '0');
INSERT INTO `cms_article` VALUES ('8', '4', '文章标题标题标题标题', '', 'blue', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/08/s2015114144555221.jpg', '关键字1,关键字2', '', '0', null, '0', ',null,', '', '', '1', '2013-05-27 08:00:00', '1', '2017-08-30 17:45:12', null, '1');
INSERT INTO `cms_article` VALUES ('845b8f2ffdbf449e9ad6fcd7c20bd00c', '644a235eecb642afb660cb678d935ae3', '光电采暖', '', '', '', '光电采暖', '光电采暖', '0', null, '0', ',null,', '', '', '1', '2017-09-14 15:08:58', '1', '2017-09-14 15:08:58', null, '0');
INSERT INTO `cms_article` VALUES ('84fe7014252141268859e0e2863436b5', 'd144b931d6e34941ad687d0b7c7ee161', '合作政策', '', '', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/09/ind-xt13.jpg', 'Cooperation policy', '问鼎中电万投系列光伏产品区域代理，独占当地庞大市场，赚取阳光财富，相信是每个投资者的人生梦想。与中电万投合作，根据自身投资条件，既可以成为代理商，也可以成为经销商，还可以成为居间商。不论客户选择哪种合作模式，中电万投总部提供如下支持&hellip;&hellip;', '0', null, '2', ',null,', '', '', '1', '2017-09-15 10:25:52', '1', '2017-09-15 10:25:52', null, '0');
INSERT INTO `cms_article` VALUES ('8ab68aae28da4e0db6e1175511b74799', 'd144b931d6e34941ad687d0b7c7ee161', '并网材料', '', '', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/09/ind-xt11.jpg', 'Grid material', '并网申请流程个人用户需要带上身份证、户口本、房产证等相关材料办理，企业用户带上营业执照、个人户口本、土地证、房产证、项目材料等相关材料到当地供电营业厅办理申请，目前各省电力部门执行国家对太阳能发电相关规定的优惠政策，并网安装、调试，直至验收&hellip;&hellip;', '0', null, '0', ',null,', '', '', '1', '2017-09-15 10:24:26', '1', '2017-09-15 10:24:26', null, '0');
INSERT INTO `cms_article` VALUES ('8c67949673814eb5a83794a19a0e3d1f', '644a235eecb642afb660cb678d935ae3', '光伏路灯', '', '', '', '光伏路灯', '', '0', null, '1', ',null,', '', '', '1', '2017-09-14 15:08:44', '1', '2017-09-14 15:08:44', null, '0');
INSERT INTO `cms_article` VALUES ('8c8a636b777146cca1e362cca150659e', 'd144b931d6e34941ad687d0b7c7ee161', '售后服务', '', '', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/09/ind-xt12.jpg', 'After-sales service', '对于光伏发电，由于国家补贴期限超过20年，所以产品的质保与售后系列服务尤为重要。中电万投团队高瞻远瞩，明白光伏发电行业属于一个特殊行业，售后服务只有起点，没有终点。客户成交并非是销售的终止，而是下次销售活动的开始。口碑效应源于完善周到的服务&hellip;&hellip;', '0', null, '1', ',null,', '', '', '1', '2017-09-15 10:25:15', '1', '2017-09-15 10:25:15', null, '0');
INSERT INTO `cms_article` VALUES ('8da346ee82bb4f4f8765c814943e56e0', 'd144b931d6e34941ad687d0b7c7ee161', '答疑解惑', '', '', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/09/ind-xt14.jpg', 'The answer', '1、光伏发电补贴标准全国是统一的吗？ 答：光伏补贴最先是由国家提出来的，但不少地区为支持本地光伏产业的发展，出台地方财政再次补贴政策，实行双向补贴。国家补贴标准全国都是统一的，但地方补贴标准各地略有差异，敬请客户咨询当地电力有关部门&hellip;&hellip;', '0', null, '3', ',null,', '', '', '1', '2017-09-15 10:26:59', '1', '2017-09-15 10:26:59', null, '0');
