INSERT INTO `cms_article` VALUES ('9c38915af49e4e048ab8210b5c3d183f', '644a235eecb642afb660cb678d935ae3', '多晶硅光伏板', '', '', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/09/cp2.jpg', '', '多晶硅光伏板', '0', null, '1', ',null,', '', '', '1', '2017-09-14 15:07:03', '1', '2017-09-14 18:16:19', null, '0');
INSERT INTO `cms_article` VALUES ('a46943356a764e2ab2bb9a047696ddd3', '4', '光伏扶贫', '', '', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/09/ind-xt7.jpg', 'Poverty alleviation', '光伏扶贫是国内首创的精准扶贫，精准脱贫的有效扶贫模式，被国家列为十大精准扶贫工程之一，正在向全国贫困地区推广运用。他主要通过五种方式为人们提供扶贫服务：一是结合危房改造，异地搬迁等，直接在贫困户屋顶建设时安装光伏发电工程。二是在贫困户屋顶&hellip;&hellip;', '0', null, '8', ',null,', '', '', '1', '2017-08-30 17:48:35', '1', '2017-09-14 14:47:33', null, '0');
