INSERT INTO `cms_article` VALUES ('b7d82a22d0374ef08348c27b3abc2177', 'd144b931d6e34941ad687d0b7c7ee161', '专家教授', '', '', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/09/ind-xt9.jpg', 'Experts professors', '姓名：张森；教育背景：清华大学本科（62届），工业与民用建筑专业；职称：高级工程师、注册咨询师。主要工作经历：藏学研究中心工程、长新大厦工程、嘉里大厦、安慧北里小区工程、中环世贸工程、远洋大厦工程、华夏银行工程、金融街B7工程、金融&hellip;&hellip;', '0', null, '6', ',null,', '', '', '1', '2017-09-15 10:22:11', '1', '2017-09-15 10:35:27', null, '0');
INSERT INTO `cms_article` VALUES ('bb34c1315d0b4374b7d6ca73d1c0ae79', '4', '收益分析', '', '', '/hbhjgf/userfiles/1/_thumbs/images/cms/article/2017/09/ind-xt3.jpg', 'Benefit analysis', '对家庭分布式光伏电站实行按照全电量补贴的政策，电价补贴标准为每千瓦时0.42元（含税），通过可再生能源发展基金予以支持，由电网公司转付，其中，分布式光伏发电系统自发自用余电上网的电量，由电网企业按照当地燃煤机组标杆上网电价收购&hellip;&hellip;', '0', null, '9', ',null,', '', '', '1', '2017-08-30 17:46:33', '1', '2017-09-14 13:59:35', null, '1');
